import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {

  form: FormGroup;
  spinner:boolean=false;

constructor(private fb: FormBuilder,private router: Router){

  this.form = this.fb.group({
    usuario: ['', Validators.required],
    pass: ['', Validators.required]

  })

}

login(){

  console.log(this.form.value)
  const usuario = this.form.value.usuario;
  const pass = this.form.value.pass;
  if(usuario == "j" && pass == "12345"){
    console.log("entrando al metodo vvvv")
    this.router.navigate(['dashboard']);
  }

}




}
<div class="card">
  <div class="card-body">
    <div>
      <form >
        <div class="col-auto">
          <label for="inputPassword6" class="col-form-label">Usuario</label>
        </div>
        <div class="col-auto">
          <input
            type="text"
            id="inputPassword6"
            class="form-control"
            aria-describedby="passwordHelpInline"
            ngModel="usuario"
            required="true"
          />
        </div>
        <div class="col-auto">
          <label for="inputPassword6" class="col-form-label">Password</label>
        </div>
        <div class="col-auto">
          <input
            type="password"
            id="inputPassword6"
            class="form-control"
            aria-describedby="passwordHelpInline"
            ngModel="pass"
            required="true"
          />
        </div>
        <div class="button_login">
          <button  (ngSubmit)="login()" type="submit" class="btn btn-primary" [disabled]="form.invalid" type="button">Ingresar</button>
        </div>
      </form>
    </div>
  </div>
</div>
